import React from "react";

const AplicacionCrudTableRow = ({el, setDataToEdit,deleteData})=>{//destructuracion del obejeto

    let {nombre,apellido,dni,id} = el;
    return(
        <tr class="tabla-resultados">
            <td>{nombre}</td>
            <td>{apellido}</td>
            <td>{dni}</td>
            <td>
                <button onClick={()=>setDataToEdit(el)}>Corregir</button>
                <button onClick={()=>deleteData(id)}>Eliminar</button>
            </td>

        </tr>
    );
};
export default AplicacionCrudTableRow;
